<script>
    window.getParams=function(k) {return new URLSearchParams(window.location.search).get(k)}
    // let gor=getParams('or')
    function isStartWithNum(numStr) {
        try {
            var num = numStr.charCodeAt(0);     // 获取首个字符的code值
            return (48 <= num && num <= 57);
        } catch {
            return false;
        }
    }

    function fromOr() {
        const or = decodeURIComponent(getParams('or'))
        if(!isStartWithNum(or)) {
            return or
        }
        const num2 = parseInt(or.substring(0, 2))
        return or.slice(2).replace(/[a-zA-Z\-_=.]/g, function (ch) {
            if (num2 > 0 && "-" === ch) {
                return ch;
            }
            if (num2 > 0 && "=" === ch) {
                return ".";
            }
            if (num2 < 0 && "-" === ch) {
                return ch;
            }
            if (num2 < 0 && "." === ch) {
                return "=";
            }
            return String.fromCharCode(ch.charCodeAt(0) - num2)
        });
    }
    let gor = fromOr()

    window._open = window.XMLHttpRequest.prototype.open
    window.XMLHttpRequest.prototype.open = function (method, url, async) {// console.log('xhr : ', url);
        let host = window.location.host.split('.').slice(-2).join('.')
        if (url.includes('api.' + host)) {
            if (window.location.hostname.includes('localhost') || window.location.hostname.includes('192.')) {
                url = url.replace("https://api." + host, "http://" + window.location.hostname + ":13001")
            }else{
                url = url.replace("https://api." + host, "https://" + window.location.hostname)
            }
        }
        if (url.includes(gor)) {
            url = url.replace(gor, window.location.host);
        }
        if (url.includes('/shared/')) {// url = url.replace(/http:\/\/[^\/]+\//,window.location.origin+window.location.pathname)
            const nameReplace = window.location.pathname.replace('index.html', '')
            url = url.replace('/shared/', nameReplace + 'shared/');
        }

        // console.log('xhr : ', url);
        let ret = window._open.apply(this, arguments)

        this.setRequestHeader('skey', getParams('ot'));
        this.setRequestHeader('btt', getParams('btt'));
        this.setRequestHeader('uid', getParams('uid'));
        if (url.includes('/index.'))this.setRequestHeader('Cache-Control', 'no-cache');

        return ret;
    }

    window._fetch = window.fetch;
    window.fetch = function (url) {
        const nameReplace = window.location.pathname.replace('index.html', '')
        if(typeof(url) == 'string') {
            if (url.includes(gor)) {
                url = url.replace(gor, window.location.host);
            }
            url = url.replace('/shared/', nameReplace + 'shared/');
            if(window.sendFileUrl)window.sendFileUrl(url)
        }else{
            if (url.href.includes(gor)) {
                url.href = url.href.replace(gor, window.location.host);
            }
            url.href = url.href.replace('/shared/', nameReplace + 'shared/');
            if(window.sendFileUrl)window.sendFileUrl(url.href)
        }

        // console.log('fetch url:', url)
        return window._fetch.apply(window, arguments);
    }
